import Nimble
import Quick

@testable import ExponeaSDK

final class GIFTest: QuickSpec {

    private let gifImage =  """
            
            """

    override func spec() {
        it("gif test") {
            let gifData = Data(base64Encoded: self.gifImage) ?? .init()
            let isGif = UIImage.isGif(data: gifData)
            expect(isGif).to(beTrue())
        }
    }
}
